import "./Supermarket.css";

const Supermarket = () => {
  return (
    <div className="backgroundSuper">
      <div className="bannerSuper" id="landing">
        Supermarket
      </div>
      <div>
        <div className="mapImage"></div>
        <div className="mapLink"> <a href="https://goo.gl/maps/9vRLjczTEsrK8Gcn7" rel="noreferrer" target="_blank"></a></div>
      </div>
    </div>
  );
};

export default Supermarket;
